INSERT INTO `reports` (`report_id`, `report_name`, `report_desc`, `report_sql`, `report_access`, `report_input_type`, `report_inputs`) VALUES
(1, 'DT Energy Audit and Coverage', 'DT Energy Audit and Coverage', 'select * from report_dt_audit_and_coverage\r\nwhere str_to_date(CONCAT(UCASE(LEFT(LCASE(LOG_DATE), 1)), \r\n                             SUBSTRING(LCASE(LOG_DATE), 2)),\'%d-%b-%y %H:%i\') >= \r\n                             str_to_date(CONCAT(UCASE(LEFT(LCASE(:from_date), 1)), \r\n                             SUBSTRING(LCASE(:from_date), 2)),\'%d-%b-%y %H:%i\') \r\nand str_to_date(CONCAT(UCASE(LEFT(LCASE(LOG_DATE), 1)), \r\n                             SUBSTRING(LCASE(LOG_DATE), 2)),\'%d-%b-%y %H:%i\') <=\r\n                             str_to_date(CONCAT(UCASE(LEFT(LCASE(:to_date), 1)), \r\n                             SUBSTRING(LCASE(:to_date), 2)),\'%d-%b-%y %H:%i\') ;', '2', 'date,date', ':from_date,:to_date'),
(2, 'Report Sanctioned Load Violation Based On Max Demand ', 'Report Sanctioned Load Violation Based On Max Demand ', 'select * from report_sanctioned_load_violation_based_on_max_demand \r\nwhere str_to_date(CONCAT(UCASE(LEFT(LCASE(VIOLATION_DATE), 1)), \r\n                             SUBSTRING(LCASE(VIOLATION_DATE), 2)),\'%d-%b-%y %H:%i\') >= \r\n                             str_to_date(CONCAT(UCASE(LEFT(LCASE(:from_date), 1)), \r\n                             SUBSTRING(LCASE(:from_date), 2)),\'%d-%b-%y %H:%i\') \r\nand str_to_date(CONCAT(UCASE(LEFT(LCASE(VIOLATION_DATE), 1)), \r\n                             SUBSTRING(LCASE(VIOLATION_DATE), 2)),\'%d-%b-%y %H:%i\') <=\r\n                             str_to_date(CONCAT(UCASE(LEFT(LCASE(:to_date), 1)), \r\n                             SUBSTRING(LCASE(:to_date), 2)),\'%d-%b-%y %H:%i\') ;', '1', 'date,date', 'from_date,to_date');
